pragma solidity ^0.8.0;

import "./Adminable.sol";


contract GameForecast is Adminable{

    address public cupNft;

    struct TeamInfo {
        uint8[8] teams8;
        uint8[4] teams4;
        uint8[2] teams2;
        uint8   first;
        uint8   third;
    }

    uint8[16] public team16;


    mapping(address => uint16) userForecastNumbers;
    mapping(address => mapping(uint16 => TeamInfo)) userForecastInfo;

    function setTeam16Tokenid(uint8[16] calldata _teams16) public onlyAdmin {
        for(uint8 i = 0; i < 16; ++i) {
            team16[i] = _teams16[uint8(i)];
        }
    }

    function openForecast(uint8[8] calldata teams8, uint8[4] calldata teams4, uint8[2] calldata teams2, uint8 first, uint8 third) public onlyAdmin {

    }

    function enterForecast(uint8[8] calldata teams8, uint8[4] calldata teams4, uint8[2] calldata teams2, uint8 teams1) public {

