    function gatTeam16Tokenid() public view returns (uint8[16] memory) {

    }

    function getUserForecastInfo(address user, uint16 ForecastId) public view returns (TeamInfo memory){
        return userForecastInfo[user][ForecastId];
    }

    function getUserForecastRewards(address user, uint16 ForecastId) public view returns (uint256) {

    }

    function claimForecastRewards(uint16 ForecastId) public {

